INSERT INTO `openn_document` VALUES (46,'Ms. Codex 1223','2014-10-31 15:30:13','2014-10-31 15:30:13',0,'mscodex1223',NULL,'medren','Fragments of the Digests of Justinian, Book 37, Titles 7-9','<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\">\n   <teiHeader>\n      <fileDesc>\n         <titleStmt>\n            <title>Description of University of Pennsylvania Ms. Codex 1223: Fragments of the Digests of Justinian, Book 37, Titles 7-9</title>\n         </titleStmt>\n         <publicationStmt>\n            <publisher>The University of Pennsylvania Libraries</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by/4.0/legalcode\">\n                                This description is 2014 University of Pennsylvania Libraries. It is licensed under a Creative Commons Attribution 4.0 International License (CC-BY 4.0), http://creativecommons.org/licenses/by/4.0/. Please see the license deed for details, http://creativecommons.org/licenses/by/4.0/.\n                            </licence>\n               <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\">\n                                All images referenced here are in the public domain and are free for any use commercal or private. Please see the Creative Commons Public Domain Mark page for details, http://creativecommons.org/publicdomain/mark/1.0/.\n                            </licence>\n            </availability>\n         </publicationStmt>\n         <notesStmt>\n            <note>Ms. leaves.</note>\n            <note>Title supplied by cataloger (Zacour-Hirsch).</note>\n            <note>Layout: Main text written in 2 columns of 50-52 lines; commentary text written in 2 columns of 90-109 lines; horizontal and vertical bounding lines ruled in lead.</note>\n            <note>Script: Written in a Gothic script.</note>\n            <note>Decoration: Initials (1-line to 3-line) alternating in red and blue ink, paragraph marks in red and blue ink, six-line Title 8 initial in red and blue ink.</note>\n            <note>Binding: Modern boards.</note>\n            <note>Origin: Probably written in France in the 15th century (Zacour-Hirsch).</note>\n         </notesStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno type=\"call-number\">Ms. Codex 1223</idno>\n                  <altIdentifier type=\"bibid\">\n                     <idno>4350977</idno>\n                  </altIdentifier>\n               </msIdentifier>\n               <msContents>\n                  <summary>Bifolium with fragments from Book 37 of the Digests of Justinian I (Byzantine emperor, 527-565), containing (in order) sections of Title 7 on dowries, Title 9 on inheritance, and Title 8 on the children of marriages in which one partner is an emancipated slave. The text is surrounded by 15th-century commentary on the laws.</summary>\n                  <textLang>Latin.</textLang>\n                  <msItem>\n                     <title>Fragments of the Digests of Justinian, Book 37, Titles 7-9</title>\n                     <author>Justinian I, Emperor of the East, 483?-565</author>\n                     <respStmt>\n                        <resp>former owner</resp>\n                        <persName>Baugh, Albert C. 1891-1981</persName>\n                     </respStmt>\n                  </msItem>\n                  <msItem n=\"1r\">\n                     <locus>1r</locus>\n                     <title>De dotis collatione (37.7.1.4), f. 1r</title>\n                  </msItem>\n                  <msItem n=\"1v\">\n                     <locus>1v</locus>\n                     <title>De ventre in possessionem mittendo et curatore eius (37.9.1), f. 1v</title>\n                  </msItem>\n                  <msItem n=\"2r\">\n                     <locus>2r</locus>\n                     <title>De coniungendis cum emancipato liberis eius (37.8.1.10), f. 2r</title>\n                  </msItem>\n               </msContents>\n               <physDesc>\n                  <objectDesc>\n                     <supportDesc material=\"paper\">\n                        <support>paper</support>\n                        <extent>2 leaves : 429 x 289 (237 x 135) mm. bound to 439 x 295 mm</extent>\n                     </supportDesc>\n                  </objectDesc>\n                  <decoDesc>\n                     <decoNote n=\"1v\">Puzzle initial, Initial S, f. 1v</decoNote>\n                  </decoDesc>\n               </physDesc>\n               <history>\n                  <origin>\n                     <origDate>14--</origDate>\n                     <origPlace>France?</origPlace>\n                  </origin>\n                  <provenance>Gift of Albert C. Baugh, 1965.</provenance>\n               </history>\n            </msDesc>\n         </sourceDesc>\n      </fileDesc>\n      <profileDesc>\n         <textClass>\n            <keywords n=\"subjects\">\n               <term>Roman law.--Early works to 1800</term>\n               <term>Inheritance and succession (Roman law)</term>\n               <term>Marriage (Roman law)</term>\n               <term>Property (Roman law)</term>\n            </keywords>\n            <keywords n=\"form/genre\">\n               <term>Codices</term>\n               <term>Laws (documents)</term>\n               <term>Commentaries</term>\n               <term>Manuscripts, Latin--15th century</term>\n               <term>Manuscripts, Renaissance</term>\n            </keywords>\n         </textClass>\n      </profileDesc>\n   </teiHeader>\n   <facsimile>\n      <surface n=\"Front cover\"><graphic height=\"200px\" url=\"web/0046_0000_web.jpg\" width=\"140px\"/><graphic height=\"200px\" url=\"master/0046_0000.tif\" width=\"140px\"/><graphic height=\"190px\" url=\"thumb/0046_0000_thumb.jpg\" width=\"133px\"/></surface><surface n=\"Inside front cover\"><graphic height=\"200px\" url=\"web/0046_0001_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0001.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0001_thumb.jpg\" width=\"139px\"/></surface><surface n=\"[Flyleaf 1 recto]\"><graphic height=\"200px\" url=\"web/0046_0002_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0002.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0002_thumb.jpg\" width=\"139px\"/></surface><surface n=\"[Flyleaf 1 verso]\"><graphic height=\"200px\" url=\"web/0046_0003_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0003.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0003_thumb.jpg\" width=\"139px\"/></surface><surface n=\"1r\"><graphic height=\"200px\" url=\"web/0046_0004_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0004.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0004_thumb.jpg\" width=\"139px\"/></surface><surface n=\"1v\"><graphic height=\"200px\" url=\"web/0046_0005_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0005.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0005_thumb.jpg\" width=\"139px\"/></surface><surface n=\"2r\"><graphic height=\"200px\" url=\"web/0046_0006_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0006.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0006_thumb.jpg\" width=\"139px\"/></surface><surface n=\"2v\"><graphic height=\"200px\" url=\"web/0046_0007_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0007.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0007_thumb.jpg\" width=\"139px\"/></surface><surface n=\"[Flyleaf 1 recto]\"><graphic height=\"200px\" url=\"web/0046_0008_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0008.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0008_thumb.jpg\" width=\"139px\"/></surface><surface n=\"[Flyleaf 1 verso]\"><graphic height=\"200px\" url=\"web/0046_0009_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0009.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0009_thumb.jpg\" width=\"139px\"/></surface><surface n=\"Inside back cover\"><graphic height=\"200px\" url=\"web/0046_0010_web.jpg\" width=\"147px\"/><graphic height=\"200px\" url=\"master/0046_0010.tif\" width=\"147px\"/><graphic height=\"190px\" url=\"thumb/0046_0010_thumb.jpg\" width=\"139px\"/></surface><surface n=\"Back cover\"><graphic height=\"200px\" url=\"web/0046_0011_web.jpg\" width=\"140px\"/><graphic height=\"200px\" url=\"master/0046_0011.tif\" width=\"140px\"/><graphic height=\"190px\" url=\"thumb/0046_0011_thumb.jpg\" width=\"133px\"/></surface><surface n=\"Spine\"><graphic height=\"200px\" url=\"web/0046_0012_web.jpg\" width=\"140px\"/><graphic height=\"200px\" url=\"master/0046_0012.tif\" width=\"140px\"/><graphic height=\"190px\" url=\"thumb/0046_0012_thumb.jpg\" width=\"133px\"/></surface></facsimile>\n</TEI>\n'),(47,'Ms. Codex 1589','2014-10-31 15:30:15','2014-10-31 15:30:21',0,'mscodex1589',NULL,'medren','Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead','<?xml version=\'1.0\' encoding=\'UTF-8\'?>\n<TEI xmlns=\"http://www.tei-c.org/ns/1.0\">\n   <teiHeader>\n      <fileDesc>\n         <titleStmt>\n            <title>Description of University of Pennsylvania Ms. Codex 1589: Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead</title>\n         </titleStmt>\n         <publicationStmt>\n            <publisher>The University of Pennsylvania Libraries</publisher>\n            <availability>\n               <licence target=\"http://creativecommons.org/licenses/by/4.0/legalcode\">\n                                This description is 2014 University of Pennsylvania Libraries. It is licensed under a Creative Commons Attribution 4.0 International License (CC-BY 4.0), http://creativecommons.org/licenses/by/4.0/. Please see the license deed for details, http://creativecommons.org/licenses/by/4.0/.\n                            </licence>\n               <licence target=\"http://creativecommons.org/publicdomain/mark/1.0/\">\n                                All images referenced here are in the public domain and are free for any use commercal or private. Please see the Creative Commons Public Domain Mark page for details, http://creativecommons.org/publicdomain/mark/1.0/.\n                            </licence>\n            </availability>\n         </publicationStmt>\n         <notesStmt>\n            <note>Ms. codex.</note>\n            <note>Title supplied by cataloger.</note>\n            <note>Collation: Paper, 131; 1(-1) 2 3 4 5 6 7-9 10(-1) 11-13 14(+1) 15(-2) 16 17; contemporary foliation in red ink, upper center recto, 1-5, 7, 6, 8-53, 53--66, [67], 68-76, 78-94, [i], 95-96 (=f. 2-98); modern foliation in pencil, [v, 1-126], upper right recto. References in this record are to modern foliation. Catchwords on almost every page, lower right recto or verso.</note>\n            <note>Layout: Written in 2 columns of 27 lines (f. 2r-95v) and 2 columns of 6 staves (f. 97v-107v); frame-ruled in red ink with text ruled in lead.</note>\n            <note>Script: Written in a German Gothic script by Georg Keysser (f. 96r).</note>\n            <note>Decoration: 3 full-page borders in colored inks with architectural columns (f. 1v, 54v, 69v); 5-line initial and full scrollwork border in colored inks (f. 2r); 8-line initial in colored inks and first words in display uncials in red ink (f. 84v); 2-line initial in 2 colors and knotwork design in colored inks (f. 96r); 1- to 3-line initials in various colors throughout; rubrication, foliation, and frame-ruling in red ink.</note>\n            <note>Music: Contains Hufnagelschrift notation on 5-line staves in the Office of the Dead (f. 97r-107v), with later additions in square notation on 4-line staves (f. 108r-108v).</note>\n            <note>Binding: Original 16th-century vellum over pasteboard, gold-stamped with stamps of the Annunciation (upper cover) and the Nativity (lower cover) and gold-tooled borders; remnants of 2 pairs of ties.</note>\n            <note>Origin: Written in the Benedictine abbey in Elchingen (Bavaria), in 1596 (f. 96r).</note>\n         </notesStmt>\n         <sourceDesc>\n            <msDesc>\n               <msIdentifier>\n                  <settlement>Philadelphia</settlement>\n                  <institution>University of Pennsylvania</institution>\n                  <repository>Rare Book &amp; Manuscript Library</repository>\n                  <idno type=\"call-number\">Ms. Codex 1589</idno>\n                  <altIdentifier type=\"bibid\">\n                     <idno>4936653</idno>\n                  </altIdentifier>\n               </msIdentifier>\n               <msContents>\n                  <summary>Benedictine manuscript containing texts for Matins and Lauds from the Commemorative Office of the Virgin. This version of the Office was said most often on Saturday in place of the usual Office of the day. Also contains the Office of the Dead accompanied by musical notation for the chants. The manuscript once had leather finding tabs flush to the edge of the leaves, all but one (f. 96) of which have been torn out (for example, f. 1, 7, 69).</summary>\n                  <textLang>Latin.</textLang>\n                  <msItem>\n                     <title>Texts for the Commemorative Office of the Virgin Mary and notated Office of the Dead</title>\n                     <author>Catholic Church</author>\n                     <respStmt>\n                        <resp>scribe</resp>\n                        <persName>Keysser, Georg</persName>\n                     </respStmt>\n                  </msItem>\n                  <msItem n=\"2r\">\n                     <locus>2r</locus>\n                     <title>Antiphona et responsoria et lectiones de commune beate Marie semper virginis..., f. 2r</title>\n                  </msItem>\n                  <msItem n=\"54v\">\n                     <locus>54v</locus>\n                     <title>Lectiones infra tricesimum [assumptionis] beate Mariae semper virginis, f. 54v</title>\n                  </msItem>\n                  <msItem n=\"70r\">\n                     <locus>70r</locus>\n                     <title>De commune beatae mariae semper virginis post octavas epiphaniae usque ad purificationem, f. 70r</title>\n                  </msItem>\n                  <msItem n=\"84v\">\n                     <locus>84v</locus>\n                     <title>Psalmos omnes tam ad mattutinas quam ad laudes, ymnos, cantica, Te Deum laudamus, omnia secundum ordinem, f. 84v</title>\n                  </msItem>\n                  <msItem n=\"97r\">\n                     <locus>97r</locus>\n                     <title>Kyrie eleison, f. 97r</title>\n                  </msItem>\n                  <msItem n=\"97v\">\n                     <locus>97v</locus>\n                     <title>Antiphona ad Placebo, ad vigilias, et ad laudes, una cum responsoriis Officium pro defunctis, f. 97v</title>\n                  </msItem>\n                  <msItem n=\"108r\">\n                     <locus>108r</locus>\n                     <title>In die depositionis ingrediendo ecclesia, f. 108r</title>\n                  </msItem>\n               </msContents>\n               <physDesc>\n                  <objectDesc>\n                     <supportDesc material=\"paper\">\n                        <support>paper</support>\n                        <extent>131 leaves : 204 x 140 (166 x 107) mm. bound to 205 x 145 mm</extent>\n                     </supportDesc>\n                  </objectDesc>\n                  <decoDesc>